import React from 'react';

import './ListBikeItem.css';

const ListBikeItem = ({ items }) => {

    const { name, type, price } = items;

    return (
        <div className="listBikeItem itemBike d-flex">
            <p>{`${name} / ${type} / $${price}`}</p>
            <div>
                <button className="btn btn-danger float-right">Delete</button>
                <button className="btn btn-outline-success btn-sm float-right">Delete</button>
            </div>
        </div>
    );
};

export default ListBikeItem;
